import React from 'react';
import {logo} from '../../'
const HeaderMain = () => {
    return (
        <div className='headerMain'>
            <div id='logo' className='logo'>
                <img src='../../Image/logo.png' alt="" >
                    
                </img>
            </div>
        </div>
    );
};

export default HeaderMain;
